// Helper function to find variant by key
export function findTshirtVariant(key: string): TshirtVariant | undefined {
  return TshirtVariants.find(v => v.key === key);
}

// Helper function to find variant by catalog variant ID
export function findTshirtVariantByCatalogId(catalogVariantId: number): TshirtVariant | undefined {
  return TshirtVariants.find(v => v.catalogVariantId === catalogVariantId);
}